import React from 'react';
import axios from 'axios';
import * as config from "../services/config";

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: []
        };
    }

    componentDidMount() {
        let userAccounts = [];
        axios.get(config.userAccountManagementBackendUrl)
            .then(res => {
                this.setState({
                    users: res.data
                });

            }).catch((err) => {
            console.log(err)
        });

    }

    render() {
        const users = this.state.users.map(user => <li>{user}</li>);
        return(
            <ul>{users}</ul>
        )
    }
}

export default Main;
